import React from "react";
import { storiesOf } from "@storybook/react";

storiesOf("Welcome page", module).add(
  "welcome",
  () => {
    return (
      <>
        <h1>欢迎来到 Godzilla 组件库</h1>
        <p>Godzilla 是一个React UI组件库</p>
        <h3>安装试试</h3>
        <code>npm install Godzilla --save</code>
      </>
    );
  },
  { info: { disable: true } }
);
